import React from 'react'

type buttonProps={
    width?:number;
    height?:number;
    rounded?:boolean;
    color?:string;
    text:string;
}

const Button=(
    {width = 90,
        height = 50,
        rounded = true,
        color = 'black',
        text}:buttonProps)=>{
    return(<div>
        <button style={{height:`${height}px`,width:`${width}px`,backgroundColor:color,color:'white', border:'none'}}>
            {text}
        </button>
    </div>)

}

export default Button;
